import React from 'react'
import './OptionCell.styles.css'

interface IOptionCell {
	children: any,
	className?: string,
	borderColor?: string
	onClick?: () => void
}

export const OptionCell: React.FC<IOptionCell>=({
													children,
													className,
													onClick,
													borderColor
												}) => {
	return (
		<div className={'Main-container'} onClick={onClick}>
			<div className={`${className ? className + '-line' : 'line'} ${borderColor}` }></div>
			<div className={`Container ${className ? className : ''} ${borderColor}`}>
				{children}
			</div>
			<div className={`${className ? className + '-line' : 'line'} ${borderColor}`}></div>
		</div>
	)
}
